import { TableViewRoot } from "./Table.styles";


import { UserInfo } from "../../types";

const Table = (props : {userData:UserInfo[]}) => {

  const {userData} = props;

  return (
    <TableViewRoot>
      <div className="table">
        <div className="row">
          <div className="headerCell">Rank</div>
          <div className="headerCell">Name</div>
          <div className="headerCell">Time</div>
        </div>
        {userData.map((user, idx) => {
          return(
            <div className="row">
              <div style={{textAlign:'right'}} className="cell">#{idx}</div>
              <div className="cell">{"Manny Rodriguez"}</div>
              <div style={{textAlign:'center'}} className="cell">{"2:01"}</div>
            </div>
          )
        })}

      </div>
    </TableViewRoot>
  );
};

export default Table;
